import React from "react";
import styled from "styled-components";

const HeaderWrapper = styled.header`
  width: 100%;
  height: 55px;
  background-color: black;
`;

const AppHeader = () => {
  return <HeaderWrapper></HeaderWrapper>;
};

export default AppHeader;
